import styled from 'styled-components';
import Navbar from '../components/Navbar';

const Index = styled.div`
  background-color: black;
  margin: 0;
  padding: 0;
  box-sizing: border-box;
  color: #ffffff;
  width: 100%;
  height: 100vh;
`

export default () => {
  return (
    <Index>
      <h1>Start Learning</h1>
      <Navbar />
    </Index>
  );
}
